import React from 'react';
import Expo from './Home';
import './style.css'
import fb from './fb.jpg'
import insta from './insta.png'
import twit from './twit.png'

function App() {
  return (
    <div>
      <h1 id="logo">SPORTINFO24</h1>
  <Expo />
  <img src={fb} alt="fb" width="40" height="40"/>
  <img src={twit} alt="twit" width="40" height="50"/>
  <img src={insta} alt="insta" width="40" height="40"/>

  </div>
  );
}

export default App;
